//大学搜索
function searchCollege(objId, keyword, id)
{
	var str = ''
	var i = 1;
	for (var x in college)
	{
		if (college[x].indexOf(keyword) > -1)
		{
			if (college[x].length > 9)
			{
				var v = college[x].substring(0, 8) + '...';
			}
			else
			{
				var v = college[x];
			}
			str += '<li><a href="javascript:;" onclick="ca(\'' + objId + '\', \'' + college[x] + '\')">' + v.replace(keyword, '<strong>' + keyword + '</strong>'); + '</a></li>'
			if (i++ >= 10)
			{
				break;
			}
		}
	}
	if (str != '')
	{
		$(id).innerHTML = str;
		$(id).style.display = '';
	}
}

