function fcollege()
{
	var val = $("cat_select").value;
	if (val != ""){
		if (val == "本科"){
			$('cat').name = 'benzhuan';
			$('cat').value = '1';
		}
		else if (val == "专科"){
			$('cat').name = 'benzhuan';
			$('cat').value = '2';
		}
		else if (val == "独立"){
			$('cat').name = 'is_independ';
			$('cat').value = '1';
		}
		else if (val == "教育部直属"){
			$('cat').name = 'is_zhishu';
			$('cat').value = '1';
		}
		else if (val == "211工程"){
			$('cat').name = 'is211';
			$('cat').value = '是';
		}
		else if (val == "985工程"){
			$('cat').name = 'is985';
			$('cat').value = '是';
		}
		else if (val == "开设研究生院高校"){
			$('cat').name = 'is_yjs';
			$('cat').value = '1';
		}
		else if (val == "民办高校"){
			$('cat').name = 'is_minban';
			$('cat').value = '1';
		}
		else{
			$('cat').name = '';
			$('cat').value = '';
		}
	}
	if ($('v1').value == '输入大学名或不填')
	{
		$('v1').name = '';
	}
	else
	{
		$('v1').name = 'name';
	}
	$('fm1').submit();
}

